import '../sass/components/_reset.scss'
import '../sass/components/_menu.scss'
import { Link, animateScroll as scroll } from "react-scroll";

import { elastic as Menu } from 'react-burger-menu'
import React, { Component } from 'react'

class MenuBurger extends Component{

    howSettings (event) {
        event.preventDefault();
      }

      scrollToTop = () => {
        scroll.scrollToTop(); 
        };


    render(){
        return(
            <Menu right>
                <Link className="menu-item" activeClass="active" to="home" spy={true} smooth={true} offset={-70} duration= {500}>Accueil</Link>
                <Link className="menu-item" activeClass="active" to="competences" spy={true} smooth={true} offset={-70} duration= {500}>Comp√©tences</Link>
                <Link className="menu-item" activeClass="active" to="competences" spy={true} smooth={true} offset={-70} duration= {500}>Freelance</Link>
                <Link className="menu-item" activeClass="active" to="Projet" spy={true} smooth={true} offset={-70} duration= {500}>Projet</Link>
                <Link className="menu-item" activeClass="active" to="contact" spy={true} smooth={true} offset={-70} duration= {500}>Linkedin</Link>
                <Link className="menu-item" activeClass="active" to="contact" spy={true} smooth={true} offset={-70} duration= {500}>Github</Link>
            </Menu>
        )
    }
}

export default MenuBurger
